import React from 'react'
import './Card.css'
import { motion } from "framer-motion"

export default function Resume() {
    return (
        <motion.div
        initial={{ opacity: 0 , x: -400}}
        animate={{opacity: 1, x:0 }}
        exit={{ opacity: 0, x: -400}}
        >
            <div className="Card">
                <div className="">
                    ESTO ES EL Resume
                </div>
            </div>

        </motion.div>
    );
  }
